MERGE GameTrack.GameGenre T
USING @GameGenreStaging S ON S.GameID = T.GameID
WHEN MATCHED AND S.GenreID <> T.GenreID THEN
   UPDATE
   SET GenreID = S.GenreID
WHEN NOT MATCHED THEN
   INSERT(GameID,GenreID)
   VALUES(S.GameID,S.GenreID);
